        buttonLink2="https://wa.me/521XXXXXXXXXX?text=No puedo asistir"
        invitacion={{
          nombre: "Jose, est치s invitado a mi Fiesta",
          invitados: "Invitaci칩n para 1 adulto",
        }}
      />
    </div>
  );
};

export default Invitacion;
